import React from "react";
import Footer from "./components/Footer";
import Header from "./components/Header";
import Meme from "./components/Meme";
import Search from "./components/Search";

class App extends React.Component {
  render() {
    return (
      <>
        <Header />
        <Search />
        <Meme />
        <Footer />
      </>
    );
  }
}

export default App;
